const oddEvenJumps = (arr) => {
  const mapped = arr.map((item, index) => [index, item])
  const sorted = [...mapped].sort((a, b) => a[1] !== b[1] ? a[1] - b[1] : a[0] - b[0])
  const sortedMapped = new Map()
  sorted.forEach((item, index) => sortedMapped.set(item[0], index))
  const revSorted = [...mapped].sort((a, b) => a[1] !== b[1] ? b[1] - a[1] : a[0] - b[0])
  const revSortedMapped = new Map()
  revSorted.forEach((item, index) => revSortedMapped.set(item[0], index))

  const oddJump = (idx) => {
    const newSortedLoc = sortedMapped.get(idx)
    for (let i = newSortedLoc + 1; i < sorted.length; i++) {
      if (sorted[i][0] < sorted[newSortedLoc][0]) continue
      return sorted[i][0]
    }
    return undefined
  }

  const evenJump = (idx) => {
    const newSortedLoc = revSortedMapped.get(idx)
    for (let i = newSortedLoc + 1; i < revSorted.length; i++) {
      if (revSorted[i][0] < revSorted[newSortedLoc][0]) continue
      return revSorted[i][0]
    }
    return undefined
  }

  const odd = arr.map((_, idx) => oddJump(idx))
  const even = arr.map((_, idx) => evenJump(idx))
  const goodOdd = new Map()
  const goodEven = new Map()

  goodOdd.set(arr.length - 1, arr.length - 1)
  goodEven.set(arr.length - 1, arr.length - 1)

  for (let i = arr.length - 2; i > -1; i--) {
    if (odd[i] !== undefined && goodEven.get(odd[i])) {
      goodOdd.set(i, odd[i])
    }
    if (i === 0) break
    if (even[i] !== undefined && goodOdd.get(even[i])) {
      goodEven.set(i, even[i])
    }
  }

  return goodOdd.size
}
